import React from 'react';
import Post from '../Components/Post'

const Feed = props => {

    const feed = () => {
        return props.map((data) =>
            <Post data={data}/>
        )
    }  

    return (
        <div>
            {feed}
        </div>
    );
}

export default Feed;
